// Import the functions you need from the SDKs you need
import { initializeApp } from "firebase/app";
// import { getAnalytics } from "firebase/analytics";
import { getAuth, GoogleAuthProvider } from "firebase/auth";
// TODO: Add SDKs for Firebase products that you want to use
// https://firebase.google.com/docs/web/setup#available-libraries

// Your web app's Firebase configuration
// For Firebase JS SDK v7.20.0 and later, measurementId is optional
const firebaseConfig = {
  apiKey: "AIzaSyBO8DhQvBEeKCAQ_Y3PZ7Fe8WpTupomPnE",
  authDomain: "internle.firebaseapp.com",
  projectId: "internle",
  storageBucket: "internle.appspot.com",
  messagingSenderId: "219631840743",
  appId: "1:219631840743:web:aecfbe9194cb8869f32142",
  measurementId: "G-C6BKREG41K"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);
// const analytics = getAnalytics(app);
const auth = getAuth(app)
const provider = new GoogleAuthProvider();
export { auth, provider};

const signUpGoogleButton = document.getElementById('sign-up-google-button');

signUpGoogleButton.addEventListener('click', () => {
  const provider = new firebase.auth.GoogleAuthProvider();

  firebase.auth().signInWithPopup(provider)
    .then((result) => {
      // Handle successful sign-in
      const user = result.user;
      console.log('User:', user);
    })
    .catch((error) => {
      // Handle errors
      const errorCode = error.code;
      const errorMessage = error.message;
      console.log('Error:', errorCode, errorMessage);
    });
});

export default config;
